import React from 'react';

class HeroSection extends React.Component {
    render() {
        return (
            <div className="container">
                <h1>Help to feed frontline workers â€“ those who take care of you and your loved ones.</h1>
                <div id="landing-blurb">
                    <h2>Support all medical and ancillary professionals at the frontline of the COVID-19 pandemic.</h2>
                    <a><div className="button">Make A Donation</div></a>
                    <a><div className="button">Corporates</div></a>
                </div>
            </div>
        )
    }
}

class ImpactStatsSection extends React.Component {
    render() {
        return (
            <div className="container">
                <h2>Our Impact</h2>
                <div className="mockup">
                    <div className="flex-three-grid">
                        <div className="flex-three-container">
                            <img src="" alt="#" />
                            <h3 className="legend-header">Donations</h3>
                        </div>
                        <div className="flex-three-container">
                            <img src="" alt="#" />
                            <h3 className="legend-header">Meals Served</h3>
                        </div>
                        <div className="flex-three-container">
                            <img src="" alt="#" />
                            <h3 className="legend-header">Funds Raised</h3>
                        </div>
                    </div>
                    <p>We are active in <b>3 states</b> with <b># restaurants</b> on board.</p>
                    <a href="/donation">How you can get involved</a>
                </div>
            </div>
        )
    }
}

class ImpactCaseStudySection extends React.Component {
    render() {
        return (
            <div className="container">
                <img alt="Photo of a health professional" />
                <blockquote>Insert quote here</blockquote>
            </div>
        )
    }
}


class HomeSection4 extends React.Component {
    render() {
        return (
            <div className="container">
                <h2>How it works</h2>
                <div className="flex-four-grid">
                    <div className="feature-container">
                        <div className="feature-content">
                            <h3 className="feature-header">Search</h3>
                            <p>Search for specific locations with the accessibility features you require.</p>
                        </div>
                    </div>
                    <div className="feature-container">
                        <div className="feature-content">
                            <h3 className="feature-header">Rate</h3>
                            <p>Join our global community by rating new locations on our map with tags and descriptions.</p>
                        </div>
                    </div>
                    <div className="feature-container">
                        <div className="feature-content">
                            <h3 className="feature-header">Filter</h3>
                            <p>Filter the map to discover places with specific accessibility features.</p>
                        </div>
                    </div>
                    <div className="feature-container">
                        <div className="feature-content">
                            <h3 className="feature-header">Discover</h3>
                            <p>Browse our interactive map to discover accessible places around the world.</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

const Home = () => {
    return (<>
        <section id="section1"><HeroSection /></section>
        <section id="section2"><ImpactStatsSection /></section>
        <section id="section3"><ImpactCaseStudySection /></section>
        <section id="section4"><HomeSection4 /></section>
    </>)
};

export default Home;
